const AuthModal = ({ setShowModal }) => {

    const handleClick = () => {
        setShowModal(false);
    }

    return (
        <div className="auth-modal">
            <div onClick={handleClick}>
                <span>&#11198;</span>
                AuthModal
            </div>
        </div>
    )
}
export default AuthModal
